import React from 'react'
import ProjectSummary from './ProjectSummary';


const PorjectList =(props)=> {
    console.log(props);
    return (
        <div className="project-list section">
           <ProjectSummary baslik={this.props.title} tarih="28 Haziran 1997" yazaradi={this.props.content}></ProjectSummary>           
        </div>
    )
}

export default PorjectList;
